import React from 'react'
import {CategoriesData} from './CategoriesData'

const CategoriesBar = () => {

    const newarr = CategoriesData.map((item) => {
        for(let i = 1; i< CategoriesData.GetCategoryInfoResponse.CategoryArray.Category.length; i++) {
        CategoriesData.GetCategoryInfoResponse.CategoryArray.Category[i].CategoryNamePath
    }})
    
    return (
        <div className="Categories_Side_Container">
            <p>Categories</p>
            <p>{newarr}</p>
        </div>
    )


}

export default CategoriesBar
